Ext.data.JsonP['Dashboard_4.5.5_Release_Note']({"guide":"<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\n        \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n    <title>Dashboard 4.5.5</title>\n\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n    <meta content=\"Scroll EclipseHelp Exporter\" name=\"generator\">\n\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\" media=\"print\">\n</link></link></link></meta></meta></head>\n<body>\n    <div class=\"container\">\n        <div class=\"header\"/>\n\n        <div id=\"src-46243843\" class=\"content\">\n                        <h1>Dashboard 4.5.5</h1>\n    <p>Dashboard 4.5.5 is a patch release, which includes two improvements and one bug fix.    </p>\n    <div class=\"section section-2 \" id=\"src-46243843_Dashboard4.5.5ReleaseNote-Improvements\">\n        <h2 class=\"heading \"><span>Improvements</span></h2>\n<ul class=\" \"><li class=\" \">    <p>Analytics date range selections are now reset to the default value of &quot;Last 24 Hours&quot; after each browser session    </p>\n</li><li class=\" \">    <p>Push notification failure error messages can be viewed by hovering over the &quot;Failure&quot; status in the Push Notification Logs details.    </p>\n</li></ul>    </div>\n    <div class=\"section section-2 \" id=\"src-46243843_Dashboard4.5.5ReleaseNote-FixedIssue\">\n        <h2 class=\"heading \"><span>Fixed Issue</span></h2>\n<ul class=\" \"><li class=\" \">    <p>Fixed bug on Safari browsers where users may be prompted to provide a client certificate    </p>\n</li></ul>    </div>\n        </div><a id=\"editButton\" href=\"https://wiki.appcelerator.org/pages/editpage.action?pageId=46243843\"><span>Edit</span></a>\n    \n        \n    </div>\n</body>\n</html>\n","title":"Dashboard 4.5.5 Release Note"});